import React from "react";

export default function InsertBuy() {
  return (
    <div>
      <button
        type="button"
        className="btn btn-success"
        data-toggle="modal"
        data-target="#myModal"
      >
        เพิ่มข้อมูล
      </button>
      
    </div>
  );
}
